import React from "react";
import { useNavigate } from "react-router-dom";
import useStateRef from "react-usestateref";
//import SuccessPopUps from "../pop-ups/SuccessPopUps";
const Register = () => {
    var popTitle;
    const navigate = useNavigate();
    const [hasError, setHasError, hasNoError] = useStateRef(false);
    const submitRegister = (e) => {
        e.preventDefault();
        console.log("Submitting register form called...");
        const formdata = new FormData(e.target);
        // console.log(Object.fromEntries(formdata.entries()));
        //setHasError(false);
        // document.getElementById("p1").classList.add("d-none");
        // document.getElementById("p2").classList.add("d-none");
        // let username = data.get("username");
        // let password = data.get("password");
        // const myobject = Object.fromEntries(formdata.entries());
        // Object.entries(myobject).map(([key, value], keyIndex) => {
        //     // validateformlogin(key, value);
        // });
        // if(!hasNoError.current){
        fetch('https://localhost:8443/onlineexam/control/onUserRegistration', {
            method: 'POST',
            credentials:"include",
            headers: {
                'Content-type': 'application/json',
            },
            body: JSON.stringify(Object.fromEntries(formdata.entries())),
        }).
            then(response => response.json())
            .then(data => {
                console.log("data", data);
                if (data.result2.responseMessage === "success") {
                    popTitle = "Success!!!"
                    navigate("/");
                }
                // console.log(data.resultMap);
                // if (data.resultMap.usersRoletypeId === "ADMIN") {
                //     alert("admin logged in successfully...")
                //     navigate("/admin");
                // }
                // else if (data.resultMap.usersRoletypeId === "PERSON_ROLE") {
                //     navigate("/user")
                // }
                // else if (data.resultMap.login_condition === "error") {
                //     navigate("/");
                //     // alert("admin is not logged in....");
                // }
            })
            .catch((error) => console.log(error));
    };
    return (
        <div className="row">
            <div className="col-4"></div>
            <div className="col-4 mt-5">
                <form onSubmit={submitRegister}>
                    <legend >Create Your Account Here</legend>
                    <div class="col">
                        <div data-mdb-input-init class="form-outline">
                            <label class="form-label float-start" for="form3Example1">
                                First name
                            </label>
                            <input type="text" name="firstName" id="form3Example1" class="form-control" />
                        </div>
                    </div>
                    <div class="col">
                        <div data-mdb-input-init class="form-outline">
                            <label class="form-label float-start" for="form3Example2">
                                Last name
                            </label>
                            <input type="text" name="lastName" id="form3Example2" class="form-control" />
                        </div>
                    </div>
                    {/* <!-- Email input --> */}
                    <div data-mdb-input-init class="form-outline mb-4">
                        <label class="form-label float-start" for="form3Example3">
                            Email address
                        </label>
                        <input type="email" name="userLoginId" id="form3Example3" class="form-control" />
                    </div>
                    {/* <!-- Password input --> */}
                    <div data-mdb-input-init class="form-outline mb-4">
                        <label class="form-label float-start" for="form3Example4">
                            Password
                        </label>
                        <input type="password" name="currentPassword" id="form3Example4" class="form-control" />
                    </div>
                    <div data-mdb-input-init class="form-outline mb-4">
                        <label class="form-label float-start" for="form3Example4">
                            Confirm Password
                        </label>
                        <input type="password" name="currentPasswordVerify" id="form3Example4" class="form-control" />
                    </div>
                    {/* <!-- Submit button --> */}
                    <button
                        data-mdb-ripple-init
                        type="submit"
                        class="btn btn-primary btn-block mb-4"
                    >
                        Sign up
                    </button>
                    {/* <SuccessPopUps title="{popTitle}" /> */}
                </form>
            </div>
            <div className="col-4"></div>
        </div>
    );
};
export default Register;
